INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 7, "2030/12/17 14:59:59", 7001, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 7, "2030/12/17 14:59:59", 7002, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 7, "2030/12/17 14:59:59", 7003, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 10001, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 10002, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 10003, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 10004, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 12, "2030/12/17 14:59:59", 12001, 0.0, 0.0, -416.5, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 13001, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 13002, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 13003, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 13004, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 14001, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 14002, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 14003, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 14004, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 15, "2030/12/17 14:59:59", 15001, 0.0, 0.0, -470.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 16001, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 16002, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 16003, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 16004, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 17, "2030/12/17 14:59:59", 17002, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 17004, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 17005, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 17006, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 17007, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "カリン", 1, 1, 0, 1, "2015/12/17 15:00:00", 18, "2030/12/17 14:59:59", 18001, 0.0, 0.0, -363.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "カリン", 1, 2, 0, 1, "2015/12/17 15:00:00", 18, "2030/12/17 14:59:59", 18002, 0.0, 0.0, -363.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "カリン", 1, 3, 0, 1, "2015/12/17 15:00:00", 19, "2030/12/17 14:59:59", 19001, 0.0, 0.0, -470.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "カリン", 1, 4, 0, 1, "2015/12/17 15:00:00", 19, "2030/12/17 14:59:59", 19002, 0.0, 0.0, -470.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "カリン", 1, 5, 0, 1, "2015/12/17 15:00:00", 20, "2030/12/17 14:59:59", 20001, 0.0, 0.0, -470.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "カリン", 1, 6, 0, 1, "2015/12/17 15:00:00", 20, "2030/12/17 14:59:59", 20002, 0.0, 0.0, -470.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 21001, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 21002, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 21003, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 21004, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "カリン", 1, 1, 0, 1, "2015/12/17 15:00:00", 22, "2030/12/17 14:59:59", 22001, 0.0, 0.0, -430.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "カリン", 1, 2, 0, 1, "2015/12/17 15:00:00", 22, "2030/12/17 14:59:59", 22002, 0.0, 0.0, -430.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "カリン", 1, 3, 0, 1, "2015/12/17 15:00:00", 23, "2030/12/17 14:59:59", 23001, 0.0, 0.0, -430.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "カリン", 1, 4, 0, 1, "2015/12/17 15:00:00", 23, "2030/12/17 14:59:59", 23002, 0.0, 0.0, -430.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "エリコ（バレンタイン）", 1, 1, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24001, 8.0, 4.08, -385.0, 109001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 1, 2, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24002, 8.0, 5.0, -385.0, 109001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 1, 3, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24003, 8.0, 10.11, -385.0, 109001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 1, 4, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24004, 8.0, 4.0, -385.0, 109001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 1, 5, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24005, 8.0, 6.0, -385.0, 109001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 1, 6, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24006, 0.0, 0.0, 0.0, 109002);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 1, 7, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24007, 0.0, 0.0, 0.0, 109002);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 1, 8, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24008, 0.0, 0.0, 0.0, 109002);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 1, 9, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24009, 0.0, 0.0, 0.0, 109002);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "エリコ（バレンタイン）", 1, 10, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24010, 0.0, 0.0, 0.0, 109002);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "シズル（バレンタイン）", 1, 1, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24011, 8.0, 2.12, -385.0, 109101);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "シズル（バレンタイン）", 5, 2, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24012, 8.0, 4.19, -385.0, 109101);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "シズル（バレンタイン）", 2, 3, 10011, 4, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24013, 8.0, 2.3, -385.0, 109101);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "シズル（バレンタイン）", 1, 4, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24014, 0.0, 0.0, 0.0, 109102);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "シズル（バレンタイン）", 5, 5, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24015, 8.0, 5.23, -385.0, 109101);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "シズル（バレンタイン）", 1, 6, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24016, 0.0, 0.0, 0.0, 109102);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "シズル（バレンタイン）", 1, 7, 10011, 2, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24017, 8.0, 5.01, -385.0, 109101);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "シズル（バレンタイン）", 1, 8, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24018, 0.0, 0.0, 0.0, 109102);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "シズル（バレンタイン）", 1, 9, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24019, 0.0, 0.0, 0.0, 109102);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "シズル（バレンタイン）", 1, 10, 10011, 1, "2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 24020, 0.0, 0.0, 0.0, 109102);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 26001, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 26002, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 26003, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 26004, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", "シェフィ", 2, 1, 0, 1, "2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 27001, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 27002, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 27003, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 27004, 0.0, 0.0, -363.0, 105901);
