INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", "カリン", 1, 1, 0, 1, "2019/12/20 5:00:00", 32, "2020/01/04 4:59:59", 32001, 0.0, 0.0, -409.0, 190801);
