INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", "カリン", 1, 3, 0, 1, "2019/12/20 5:00:00", 33, "2020/01/04 4:59:59", 33001, 0.0, 0.0, -409.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "カリン", 1, 4, 0, 1, "2019/12/20 5:00:00", 33, "2020/01/04 4:59:59", 33002, 0.0, 0.0, -409.0, 190801);
