INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", "ペコリーヌ", 1, 1, 0, 2, "2015/12/17 15:00:00", 38, "2030/12/17 14:59:59", 38001, 0.0, 5.3, -458.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", "ペコリーヌ", 1, 2, 0, 2, "2015/12/17 15:00:00", 38, "2030/12/17 14:59:59", 38002, 0.0, 6.5, -458.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "", "ペコリーヌ", 3, 0, 0, 3, "2020/04/01", 39, "2020/04/08 23:59:59", 39005, 9999.0, 0.0, 9999.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", "カリン", 1, 2, 0, 1, "2015/12/17 15:00:00", 40, "2030/12/17 14:59:59", 40001, 0.0, 0.0, -430.0, 190801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", "シェフィ", 1, 1, 0, 1, "2015/12/17 15:00:00", 41, "2030/12/17 14:59:59", 41001, 0.0, 0.0, -363.0, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 41, "2030/12/17 14:59:59", 41002, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 41, "2030/12/17 14:59:59", 41003, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 41, "2030/12/17 14:59:59", 41004, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 42001, 0.0, 0.0, -416.5, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", "シェフィ", 1, 1, 0, 1, "2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 42002, 0.0, 0.0, -416.5, 106401);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 42003, 0.0, 0.0, -416.5, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 42004, 0.0, 0.0, -416.5, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "ペコリーヌ", 1, 1, 0, 1, "2015/12/17 15:00:00", 43, "2030/12/17 14:59:59", 43001, 0.0, 0.0, -363.0, 105801);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "コッコロ", 1, 1, 0, 1, "2015/12/17 15:00:00", 43, "2030/12/17 14:59:59", 43002, 0.0, 0.0, -363.0, 105901);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "キャル", 1, 1, 0, 1, "2015/12/17 15:00:00", 43, "2030/12/17 14:59:59", 43003, 0.0, 0.0, -363.0, 106001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "アメス", 1, 1, 0, 1, "2015/12/17 15:00:00", 44, "2030/12/17 14:59:59", 43004, 0.0, 0.0, -416.5, 123001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "アメス", 1, 2, 0, 1, "2015/12/17 15:00:00", 44, "2030/12/17 14:59:59", 43005, 0.0, 0.0, -416.5, 123001);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "アメス", 1, 3, 0, 2, "2015/12/17 15:00:00", 45, "2030/12/17 14:59:59", 43006, 0.0, 5.79, -416.5, 123001);
